export enum DashboardActionTypes {
  FORM_REQUEST = "@@dashboardData/FORM_REQUEST",
  FORM_SUCCESS = "@@dashboardData/FORM_SUCCESS",
  FORM_FAILED = "@@dashboardData/FORM_FAILED",
}

export enum SubmissionState {
  initialState = 0,
  formRequest = 1,
  formCompleted = 2,
  formFailed = 3,
}

export interface DashboardDataRequest {
  loading?: boolean;
  error?: boolean;
  success?: boolean;
  errorMessage?: string | null;
  successMessage?: string | null;
  formSubmissionState: SubmissionState;
  formData: DataValue[];
}

export type DataValue = {
  userId: number;
  title: string;
  body: string;
};
